{"operationName":"topStacks","variables":{"first":30,"after":null},"query":"query topStacks($after: String, $first: Int) {
  topStacks(first: $first, after: $after) {
    count
    pageInfo {
      hasNextPage
      endCursor
      __typename
    }
    edges {
      cursor
      node {
        jobs {
          count
          __typename
        }
        slug
        path
        id
        imageUrl
        name
        tools {
          id
          name
          imageUrl
          path
          layer {
            id
            slug
            __typename
          }
          __typename
        }
        owner {
          ... on Company {
            id
            following
            path
            name
            verified
            description
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}
